window.ctcl={submitContactForm:function(t){var e=document.getElementById("recaptcha-token"),n=document.getElementById("contact-form");e&&(e.value=t),n&&n.submit()},handleAccordionClick:function(t){t.target.classList.toggle("open")}},document.addEventListener("DOMContentLoaded",function(){Array.from(document.querySelectorAll(".accordion-section-header")).forEach(function(t){t.addEventListener("click",window.ctcl.handleAccordionClick)})});